import React,{Fragment} from 'react'
import {Link} from 'react-router-dom'

let Navbar = () => {
    return (
        <Fragment>
         <nav className="navbar navbar-dark bg-dark navbar-expand-sm">
             <div className="container-fluid">

                <Link to = "/">

                </Link>
             </div>
         </nav>
        </Fragment>
    );
};

export default Navbar;
